import React, {Component} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem } from 'reactstrap';
import {Link} from 'react-router-dom';

export class RepresentativeInstance extends Component {
    constructor(props) {
      super(props);
      this.props.name;
      this.props.party;
      this.props.state;
      this.props.active;
      this.props.bills;
    }
    render() {
      return (
        // <div className="RepresentativeInstance">
        //   politician info
        // </div>
        <h> {this.props.name} </h>
      );
    }
}

export default RepresentativeInstance;
